export const STYLE_CUSTOM = [
    {
      featureType: "all",
      elementType: "geometry.fill",
      stylers: [
        {
          weight: "2.00",
        },
      ],
    },
    {
      featureType: "all",
      elementType: "geometry.stroke",
      stylers: [
        {
          color: "#9c9c9c",
        },
      ],
    },
    {
      featureType: "all",
      elementType: "labels.text",
      stylers: [
        {
          visibility: "on",
        },
      ],
    },
    {
      featureType: "landscape",
      elementType: "all",
      stylers: [
        {
          color: "#f2f2f2",
        },
      ],
    },
    {
      featureType: "landscape",
      elementType: "geometry.fill",
      stylers: [
        {
          color: "##C0C0C0",
        },
      ],
    },
    {
      featureType: "landscape.man_made",
      elementType: "geometry.fill",
      stylers: [
        {
          color: "##C0C0C0",
        },
      ],
    },
    {
      featureType: "poi",
      elementType: "all",
      stylers: [
        {
          visibility: "off",
        },
      ],
    },
    {featureType: "road", elementType: "all", stylers: [{saturation: -100,},{lightness: 45,},],},
    {featureType: "road", elementType: "geometry.fill", stylers: [{color: "#eeeeee",},],},
    {featureType: "road", elementType: "labels.text.fill", stylers: [{color: "#7b7b7b",},],},
    {featureType: "road", elementType: "labels.text.stroke", stylers: [{color: "#ffffff",},],},
    {featureType: "road.highway", elementType: "all", stylers: [{visibility: "simplified",},],},
    {featureType: "road.highway", elementType: "geometry.fill", stylers: [{color: "#F5B041",},],},
    {featureType: "road.arterial", elementType: "labels.icon", stylers: [{visibility: "off",},],},
    {featureType: "road.arterial", elementType: "geometry.fill", stylers: [{color: "#F8C471",},],},
    {featureType: "road.local", elementType: "geometry.fill", stylers: [{color: "#bdbdbd",},],},
    {featureType: "transit", elementType: "all", stylers: [{visibility: "off",},],},
    {featureType: "water", elementType: "all", stylers: [{color: "#1565c0",},{visibility: "on",},],},
    {featureType: "water", elementType: "geometry.fill", stylers: [{color: "#1565c0",},],},
    {featureType: "water", elementType: "labels.text.fill", stylers: [{color: "#070707",},],},
    {featureType: "water", elementType: "labels.text.stroke", stylers: [{color: "#ffffff",},],},
];


export const STYLE_CUSTOM_ = [
    {featureType: "water", elementType: "geometry", stylers: [{"color": "#0f254e"}]},
    {featureType: "road",  elementType: "geometry.fill", stylers: [{"color": "#FFFFFF"}]},
    {featureType: "road",  elementType: "geometry.stroke",stylers: [{"color": "#A4A4A4"}]},
    {featureType: "road.arterial", elementType: "geometry", stylers: [{ "color": "#F1F5BA" }]},
    {featureType: "road.arterial",  elementType: "geometry.stroke",stylers: [{"color": "#A4A4A4"}]},
    {featureType: "landscape.natural", stylers: [{"color": "#aedec8"}]},
    {featureType: "landscape.natural.terrain", elementType: "geometry.fill", stylers: [{"color": "#64788d"}]},
    {featureType: "landscape.natural.landcover", stylers: [{"color": "#aedec8"}]},

    {featureType: "administrative.country", elementType: "labels.text", stylers: [{"color": "#dbdfe4"}, {"visibility": "off"}]},


    {featureType: "poi", stylers: [{"visibility": "off"}]},
    {featureType: "poi.attraction", stylers: [{"visibility": "off"}]},
    {featureType: "poi.business", stylers: [{"visibility": "off"}]},
    {featureType: "poi.government", stylers: [{"visibility": "off"}]},
    {featureType: "poi.medical", stylers: [{"visibility": "off"}]},
    {featureType: "poi.park", stylers: [{"visibility": "off"}]},
    {featureType: "poi.place_of_worship", stylers: [{"visibility": "off"}]},
    {featureType: "poi.sports_complex", stylers: [{"visibility": "off"}]},
    {featureType: "poi.school", stylers: [{"visibility": "on"}]},
];
